import random

def generate_3sat(num_vars, num_clauses):
    # Initialize an empty list to hold the clauses
    clauses = []

    # Generate random clauses
    for _ in range(num_clauses):
        # Generate a random clause with three distinct literals
        clause = []
        while len(clause) < 3:
            # Generate a random literal
            var = random.randint(1, num_vars)
            negation = random.choice([True, False])
            literal = var if not negation else -var

            # Ensure the literal is not already in the clause
            if literal not in clause and -literal not in clause:
                clause.append(literal)

        # Append the clause to the list of clauses
        clauses.append(clause)

    # Return the list of clauses
    return clauses

def print_3sat(clauses):
    # Print the 3SAT problem instance in CNF format
    print("3SAT Problem (CNF Format):")
    for clause in clauses:
        print("(" + " ∨ ".join(str(literal) for literal in clause) + ")")

# Example usage
num_vars = 3  # Number of variables
num_clauses = 4  # Number of clauses
clauses = generate_3sat(num_vars, num_clauses)
print_3sat(clauses)

