class SuperMarioLevel:
    def __init__(self, level_map):
        self.level_map = level_map
        self.start_position = (0, 0)  # Assume start at top-left corner
        self.goal_position = (len(level_map[0]) - 1, len(level_map) - 1)  # Assume goal at bottom-right corner

    def is_completable(self):
        visited = set()
        stack = [self.start_position]

        while stack:
            current_pos = stack.pop()

            if current_pos == self.goal_position:
                return True

            if current_pos in visited:
                continue

            visited.add(current_pos)
            x, y = current_pos

            # Explore neighboring positions (move left, right, or jump)
            for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                next_pos = (x + dx, y + dy)

                if self._is_valid_position(next_pos):
                    stack.append(next_pos)

        return False

    def _is_valid_position(self, pos):
        x, y = pos
        if 0 <= x < len(self.level_map[0]) and 0 <= y < len(self.level_map):
            # Check if the position is walkable (not blocked by a wall or obstacle)
            return self.level_map[y][x] != '#'
        return False

