def construct_3dm_from_3sat(variables, clauses):
    n = len(variables)
    m = len(clauses)

    # Sets X, Y, Z
    X = set(variables)
    Y = set(range(1, m+1))  # Each clause represented by a number 1 to m
    Z = {True, False}       # Truth values

    # List to hold the triples (x_i, C_j, T/F)
    triples = []

    # Construct triples based on 3SAT clauses
    for j in range(m):
        clause = clauses[j]
        for i in range(n):
            x_i = variables[i]
            if x_i in clause:
                triples.append((x_i, j+1, True))   # (x_i, C_j, T)
            elif -x_i in clause:
                triples.append((x_i, j+1, False))  # (x_i, C_j, F)

    return X, Y, Z, triples

def is_valid_3dm_solution(X, Y, Z, triples, solution):
    # Validate the solution for 3DM instance
    selected_triples = []
    selected_vars = set()

    # Collect selected triples and variables
    for var in solution:
        if var in X:
            selected_vars.add(var)
        elif var in Y:
            selected_triples.append(var)

    # Check if each element in X is covered exactly once
    if selected_vars != X:
        return False

    # Check if no two selected triples share any common element
    selected_set = set(selected_triples)
    for triple1 in selected_set:
        for triple2 in selected_set:
            if triple1 != triple2:
                if any(elem in triples[triple1-1][:2] for elem in triples[triple2-1][:2]):
                    return False

    return True

# Example 3SAT instance
variables = [1, 2, 3]
clauses = [[1, -2, 3], [-1, 2, -3]]

# Construct 3DM instance from 3SAT
X, Y, Z, triples = construct_3dm_from_3sat(variables, clauses)

# Example solution (corresponding to satisfying assignment of 3SAT)
solution = [1, 2, 3]  # Assume all variables are true

# Verify the solution for 3DM instance
is_valid_solution = is_valid_3dm_solution(X, Y, Z, triples, solution)

if is_valid_solution:
    print("The 3DM instance has a valid solution.")
else:
    print("The 3DM instance does not have a valid solution.")

