def reduce_3sat_to_subset_sum(variables, clauses):
    # Map variables to unique positive integers
    var_map = {var: i + 1 for i, var in enumerate(variables)}
    n = len(variables)
    m = len(clauses)

    # Initialize a list to hold integers for Subset Sum
    integers = []

    # Convert 3SAT clauses to Subset Sum integers
    for clause in clauses:
        a = var_map[abs(clause[0])]
        b = var_map[abs(clause[1])]
        c = var_map[abs(clause[2])]
        integers.append(a + b + c)  # Create an integer corresponding to the clause

    # Target sum for Subset Sum instance
    target_sum = n + m  # To ensure each variable and each clause contributes at least 1

    return integers, target_sum

# Example 3SAT instance
variables = [1, 2, 3]
clauses = [[1, -2, 3], [-1, 2, -3]]

# Reduce 3SAT to Subset Sum
integers, target_sum = reduce_3sat_to_subset_sum(variables, clauses)

print("Integers:", integers)
print("Target Sum:", target_sum)

