def is_partitionable(set_of_integers, partition):
    total_sum = sum(set_of_integers)
    target_sum = total_sum // 2

    # Check if the total sum is even
    if total_sum % 2 != 0:
        return False

    # Check if the partition sums are equal to target_sum
    partition_sum = sum(partition)
    return partition_sum == target_sum

# Example usage:
set_of_integers = [1, 5, 11, 5]
partition = [1, 5, 5]  # Example partition, should sum up to 11

if is_partitionable(set_of_integers, partition):
    print("The set can be partitioned into two subsets with equal sums.")
else:
    print("The set cannot be partitioned into two subsets with equal sums.")

def reduce_subset_sum_to_partition(set_of_integers, target_sum):
    # Check if the total sum of integers is odd (impossible to partition into equal sums)
    total_sum = sum(set_of_integers)
    if total_sum % 2 != 0:
        return None

    # Create a new set by adding the negative of the target_sum to the set_of_integers
    extended_set = set_of_integers + [-target_sum]

    return extended_set

# Example usage:
set_of_integers = [1, 3, 5, 9, 12]
target_sum = 8

partition_instance = reduce_subset_sum_to_partition(set_of_integers, target_sum)
if partition_instance is not None:
    print("Reduced to Partition instance:", partition_instance)
else:
    print("Subset Sum cannot be reduced to a Partition instance.")

