class Rectangle:
    def __init__(self, width, height):
        self.width = width
        self.height = height

def reduce_3sat_to_rectangle_packing(variables, clauses):
    rectangles = []

    # Create a rectangle for each variable
    for var in variables:
        rectangles.append(Rectangle(width=1, height=1))  # Each variable represented by a 1x1 rectangle

    # Create clauses and pack rectangles accordingly
    clauses_rectangles = []

    for clause in clauses:
        clause_rectangles = []
        for literal in clause:
            var_index = abs(literal) - 1
            if literal > 0:
                clause_rectangles.append(rectangles[var_index])  # Positive literal
            else:
                # Create a new rectangle to represent negation of the variable
                negation_rect = Rectangle(width=1, height=1)
                clause_rectangles.append(negation_rect)  # Negative literal
        clauses_rectangles.append(clause_rectangles)

    return rectangles, clauses_rectangles

# Example 3SAT instance
variables = [1, 2, 3]
clauses = [[1, -2, 3], [-1, 2, -3]]

# Reduce 3SAT to Rectangle Packing
rectangles, clauses_rectangles = reduce_3sat_to_rectangle_packing(variables, clauses)

# Print rectangles and clause configurations
print("Rectangles:")
for idx, rect in enumerate(rectangles):
    print(f"Variable {variables[idx]}: {rect.width}x{rect.height}")

print("\nClauses and Corresponding Rectangles:")
for idx, clause_rects in enumerate(clauses_rectangles):
    print(f"Clause {idx + 1}: {[variables[idx] for idx, _ in enumerate(clause_rects)]}")

