def subset_sum_to_4_partition(set_of_integers, target_sum):
    # Calculate the desired sum for each subset in 4-Partition
    subset_sum = target_sum // 4

    # Check if the total sum is divisible by 4
    if target_sum % 4 != 0:
        return None  # Cannot partition into four equal subsets

    # Create a list of four empty subsets
    subsets = [[] for _ in range(4)]

    # Try to assign each integer to one of the subsets
    for num in set_of_integers:
        assigned = False
        for i in range(4):
            if sum(subsets[i]) + num <= subset_sum:
                subsets[i].append(num)
                assigned = True
                break
        if not assigned:
            return None  # Cannot partition the set

    # Check if all subsets have the desired sum
    for subset in subsets:
        if sum(subset) != subset_sum:
            return None  # Invalid partition

    return subsets  # Valid partition into four equal subsets

# Example Subset Sum instance
set_of_integers = [1, 2, 3, 4, 5]
target_sum = 15

# Reduce Subset Sum to 4-Partition
partition = subset_sum_to_4_partition(set_of_integers, target_sum)

if partition is not None:
    print("Subset Sum instance reduced to 4-Partition:")
    for i, subset in enumerate(partition):
        print(f"Subset {i+1}: {subset}")
else:
    print("Subset Sum cannot be reduced to a valid 4-Partition instance.")

