def reduce_jigsaw_to_4_partition(tile_sizes):
    total_sum = sum(tile_sizes)

    # Check if the total sum is divisible by 4
    if total_sum % 4 != 0:
        return None, None

    subset_sum = total_sum // 4

    # Create a list of integers based on tile sizes
    integers = tile_sizes

    # Target sums for 4-Partition (four equal subsets)
    target_sums = [subset_sum] * 4

    return integers, target_sums

# Example Jigsaw Puzzles instance (tile sizes)
tile_sizes = [2, 3, 4, 5, 6, 7, 8, 9]

# Reduce Jigsaw Puzzles to 4-Partition
integers, target_sums = reduce_jigsaw_to_4_partition(tile_sizes)

if integers is not None and target_sums is not None:
    print("Reduced 4-Partition instance:")
    print("Integers:", integers)
    print("Target Sums:", target_sums)
else:
    print("Cannot reduce Jigsaw Puzzles instance to 4-Partition.")